import {Component} from 'react';
import ReactMapGL, {Popup,Marker} from 'react-map-gl';
import Form from '../components/Form'
class Map extends Component {
    state = {
        viewport: {
            width: '100vw',
            height: '100vh',
            latitude: 41.390205,
            longitude:2.154007 ,
            zoom: 11
        },
        array:[1,2,3,4,5,6]
    };

    render() {
        return (

            <ReactMapGL
                mapStyle="mapbox://styles/mapbox/streets-v9"
                mapboxApiAccessToken="pk.eyJ1IjoiZHJlYXp6IiwiYSI6ImNqcnNkMjhxMTBqMXo0NG52cW1pMGd0NnQifQ.Pd6wO6XvwiskVEt38xXG5A"
                onViewportChange={(viewport) => this.setState({viewport})}
                {...this.state.viewport}>

                <Marker latitude={41.390205} longitude={2.154007} offsetLeft={-20} offsetTop={-10}>
                <Popup latitude={41.390205} longitude={2.154007} closeButton={true} closeOnClick={false} anchor="top">
                   <div>hi</div>
                  </Popup>
                </Marker>

            </ReactMapGL>
          );
    }
}

export default Map;
